## Descrição
Após muitas pesquisas, foi decidido que as tecnologias a serem usadas serão HTML, Javascript e React. Logo, o objetivo dessa issue é a capacitação em tais tecnologias.

### Tarefas

- [x] Estudar HTML e CSS;
- [x] Estudar Javascript;
- [x] Estudar o framework React.

## Descrição
O objetivo desta issue é capacitar o time de Back-end com a tecnologia escolhida, o Python, proporcionando um estudo aprofundado dos principais frameworks web disponíveis: Django e Flask. O time terá a responsabilidade de decidir qual framework será adotado para o projeto, com base no conhecimento adquirido durante o estudo.

### Tarefas
- [x] Estudar a fundo Python;
- [x] Decidir qual framework será utilizado.
- [x] Estudar os frameworks separadamente (Django e Flask);
